import React from "react";
import ReactDOM from "react-dom";
import "./index.css" ;

const FirstBook={
    title:"Book 1",
    author:"Author 1",
    img:"https://upload.wikimedia.org/wikipedia/en/thumb/9/9a/Trollface_non-free.png/330px-Trollface_non-free.png"
}

const secondBook={
    title: "Book2",
    author: "Author 2",
    img : "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR6SJ3XPQ7Ysv-y1JZSVOAOUvGOCIKT7TWk7g&usqp=CAU"
}



function BookList(){
    return (
        <section >
            <Book 
                title={FirstBook.title}
                img={FirstBook.img}
                author={FirstBook.author}   
            />
            <Book
                title={secondBook.title}
                img={secondBook.img}
            
            
            
            />


        </section>
    );
}
const Book=(props) => {
    const title="hello there"
    console.log(props);
    return (
        <div>
            <h1>{props.title}</h1>
            <img src={props.img} 
            alt="why you do this to me"></img>
            <h4>{props.author}</h4>
        </div>
    )
}

ReactDOM.render(<BookList/>,document.getElementById('root'));
